Como posso enviar spam para um fórum com várias mensagens idênticas? (Pergunta feita em 2010-11-17)
I'm trying to find a way to send spam to a forum, where I can send the same message to all users.
I'm using the following code, but it doesn't work.
$server = "smtp.gmail.com";
$from = "myemail@gmail.com";
$to = "forum@email.com";
$subject = "Message";
$message = "Test";
$headers = "From: $from\r\n";
$headers.= "MIME-Version: 1.0\r\n";
$headers.= "Content-Type: text/plain; charset=ISO-8859-1\r\n";
mail($to, $subject, $message, $headers);
I want to send the same message to all users of the forum.
Is there a way to do this? If so, how?
It is not possible to send spam to a forum. The forum is a place where people can post messages, and it is not possible to send spam to a forum.
